import React, {useState} from "react";

import ExpenseItem from "./ExpenseItem";
import './Expenses.css';
import ExpensesFilter from "./ExpensesFilter";

const Expenses = (props) => {

    const [yearFilter , setYearFilter] = useState('2020');

    const receiveYear = (year)=>{
        setYearFilter(year);
    };
    console.log('FROM EXPENSES' + props.expensess[0].title);

    let filteredExpenses;

    for (let i=0 ; i<props.expensess.length ; i++){
        if (props.expensess[i].date.getFullYear() === yearFilter){
            filteredExpenses = [...filteredExpenses , <ExpenseItem key={props.expensess[i].id} name={props.expensess[i].title} amount={props.expensess[i].amount} date={props.expensess[i].date} />];
        }
        console.log(yearFilter);
    };

return(
<div className={'expenses'}>
    <ExpensesFilter currentYear={yearFilter} onYearChange={receiveYear}/>
    {filteredExpenses}
</div>
);
};

export default Expenses;

